import React from "react";
import { MantineProvider, Avatar } from "@mantine/core";

export default function Newempform() {
  return (
    <div className="bg-white p-3 rounded-md h-screen">
      <div>
        <div>
          <h4 className="font-bold">Add Profile Picture</h4>
          <div className="flex">
            <div className="mt-2">
              <MantineProvider>
                <Avatar
                  className="w-24  bg-[#EBE9F6] p-2 rounded-md"
                  src="./profilepic.png"
                  alt="it's me"
                //   style={{width:'100px'}}
                />
              </MantineProvider>
            </div>
            <div>Hello</div>
          </div>
        </div>
      </div>
    </div>
  );
}
